import styled from 'styled-components';

const Footer = () => {
  return (
    <FooterBox>
      <CenterBox>
        <CategoryBox>
          <LogoBox>
            <Logo src='https://s3.ap-northeast-2.amazonaws.com/static.wanted.co.kr/images/logo_wanted_black.png' />
          </LogoBox>
          <CategoryList>
            <CategoryItem>기업소개</CategoryItem>
            <CategoryItem>이용약관</CategoryItem>
            <CategoryItem>개인정보 처리방침</CategoryItem>
            <CategoryItem>고객센터</CategoryItem>
          </CategoryList>
          <IconBox>
            <a href=""><Icons src='https://s3.ap-northeast-2.amazonaws.com/static.wanted.co.kr/images/social_instagram.png'/></a>
            <a href=""><Icons src='https://s3.ap-northeast-2.amazonaws.com/static.wanted.co.kr/images/social_youtube.png'/></a>
            <a href=""><Icons src="https://s3.ap-northeast-2.amazonaws.com/static.wanted.co.kr/images/social_facebook.png" /></a>
            <a href=""><Icons src="https://s3.ap-northeast-2.amazonaws.com/static.wanted.co.kr/images/social_blog.png" /></a>
            <a href=""><Icons src="https://s3.ap-northeast-2.amazonaws.com/static.wanted.co.kr/images/social_kakao.png" /></a>
            <a href=""><Icons src="https://s3.ap-northeast-2.amazonaws.com/static.wanted.co.kr/images/social_post.png" /></a>
            <a href=""><Icons src="https://s3.ap-northeast-2.amazonaws.com/static.wanted.co.kr/images/social_apple.png" /></a>
            <a href=""><Icons src="https://s3.ap-northeast-2.amazonaws.com/static.wanted.co.kr/images/social_google.png" /></a>
          </IconBox>
        </CategoryBox>
      </CenterBox>
    </FooterBox>
  )
}

const FooterBox = styled.div`
  padding: 18px 0 65px;
  border-top: 1px solid #ececec;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  background: #fff;
`
const CenterBox = styled.div`
  max-width: 1060px;
  width: 100%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`
const CategoryBox = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: space-between;
`
const LogoBox = styled.div`
`
const Logo = styled.img`
  width: 110px;
`
const CategoryList = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
`
const CategoryItem = styled.div`
`
const IconBox = styled.div`
`
const Icons = styled.img`
`
export default Footer;
